import React, { Component } from "react";
import HomePhoto from "../assets/homephoto2.png";

class HomeView extends Component {
  render() {
    return (
      <div
        style={{
          backgroundImage: `url(HomePhoto)`,
          paddingTop: 50,
          padding: 50,
          paddingBottom: 50,
          backgroundPosition: "center",
          backgroundSize: "cover",
          backgroundRepeat: "no-repeat",
          width: "100vw",
          height: "100vh",
        }}
        className="jumbotron jumbotron-fluid"
        className="text-right p-5"
      >
        <div className="container">
          <h2 className="display-4" className="text-right pr-5 pt-5 mt-5">
            Photography made simple
          </h2>
          <p className="lead medium" className="text-riight pr-5 mt-1">
            Need a talented individual to cover an <br />
            occasion? Browse through our list of curated <br />
            photographers or let us find one for you
          </p>
          <a a className="btn btn-outline-light text-center mr-2 mt-2" href="#">
            Book Now
          </a>
          <a a className=" btn btn-outline-light mr-5 mt-2" href="#">
            Recommendation
          </a>
        </div>
      </div>
    );
  }
}

export default HomeView;
